import React, { useState } from "react";
import "../Profile/Profile.css";
import { userStore } from "../../stores/UserStore";
import { useNavigate } from "react-router-dom";

function Profile() {
    const [inputs, setInputs] = useState({});
    const navigate = useNavigate();
    const updateUserStore = userStore(state => state);

    const username = userStore(state => state.username);
    const email = userStore(state => state.email);
    const firstName = userStore(state => state.firstName);
    const lastName = userStore(state => state.lastName);
    const phone = userStore(state => state.phone);
    const photoURL = userStore(state => state.photoURL);

    const handleChange = (event) => {
        const name = event.target.name;
        const value = event.target.value;

        setInputs(values => ({...values, [name]: value}));
    }

    const handleSubmit = async (event) => {
        event.preventDefault();
        
        const user = {
            username: username,
            email: inputs.email,
            firstName: inputs.firstName,
            lastName: inputs.lastName,
            phone: inputs.phone,
            photoURL: inputs.photoURL
        };

        try {
            const response = await fetch(`http://localhost:8080/project_backend/rest/users/update/${username}`, {
                method: "PUT",
                headers: {
                    "Content-Type": "application/json",
                    token: userStore(state => state.token)
                },
                body: JSON.stringify(user),
            });

            if (response.ok) {
                const user = await response.json();
                updateUserStore.updateEmail(user.email);
                updateUserStore.updateFirstName(user.firstName);
                updateUserStore.updateLastName(user.lastName);
                updateUserStore.updatePhone(user.phone);
                updateUserStore.updatePhotoURL(user.photoURL);

                navigate('/home', { replace: true });
            }
            else {
                const responseBody = await response.text();
                console.error("Error updating profile:", response.statusText, responseBody);
            }
        }
        catch (error) {
            console.error("Error updating profile:", error);
        }
    }


  return (
    <div>
      <div className="editProfilePanel">
      <label id="username-title-editProfile">{ username }</label>
            <form class="editProfile-register" id="edit-profile-form" onSubmit={handleSubmit}>
                <div class="editProfile-fieldsContainer">
                    <div class="left-fields-editProfile">
                        <label class="labels-edit-profile" id="email-editProfile-label">Email</label>
                        <input type="email" class="editProfile-fields" id="email-editProfile" name="email" onChange={handleChange} required  value={u}></input>
                        <label class="labels-edit-profile" id="firstName-editProfile-label">First Name</label>
                        <input type="text" class="editProfile-fields" id="firstName-editProfile" name="firstName" onChange={handleChange} required >{ firstName }</input>
                        <label class="labels-edit-profile" id="lastName-editProfile-label">Last Name</label>
                        <input type="text" class="editProfile-fields" id="lastName-editProfile" name="lastName" onChange={handleChange} required >{ lastName }</input>
                        <label class="labels-edit-profile" id="phone-editProfile-label">Phone</label>
                        <input type="text" class="editProfile-fields" id="phone-editProfile" name="phone" onChange={handleChange} required >{ phone }</input>
                        <label class="labels-edit-profile" id="photoURL-editProfile-label">Photo URL</label>
                        <input type="url" class="editProfile-fields" id="photoURL-editProfile" name="photoURL" onChange={handleChange} required >{ photoURL }</input>
                    </div>
                </div>
                <div class="editProfile-Buttons">
                        <button type="submit" id="profile-save-button">Save</button>
                        <button type="reset" id="profile-cancel-button">Cancel</button>
                </div>
            </form>
            </div>
    </div>
  );
}

export default Profile;
